(56, 'woocommerce-WooPayments-Aug-2023-security-updated', 'update', 'en_US', 'Security update of WooPayments (WooCommerce Payments) plugin', '<strong>Your store has been updated to the more secure version of WooPayments (WooCommerce Payments)</strong>. This update was released on July 31.', '{}', 'pending', 'woocommerce.com', '2023-10-20 18:08:46', NULL, 0, 'plain', '', 0, 0, 'info'),
(57, 'avalara_q3-2023_noAvaTax', 'marketing', 'en_US', 'Automatically calculate VAT in real time', 'Take the effort out of determining tax rates and sell confidently across borders with automated tax management from Avalara AvaTax including built-in VAT calculation when you sell into or across the EU and UK. Save time and stay compliant when you let Avalara do the heavy lifting.', '{}', 'pending', 'woocommerce.com', '2023-10-20 18:08:46', NULL, 0, 'plain', '', 0, 0, 'info'),
(58, 'woo-activation-survey-blockers-22AUG23', 'info', 'en_US', 'How can we help you get that first sale?', 'Your feedback is vital. Please take a minute to share your experience of setting up your new store and whether anything is preventing you from making those first few sales. Together, we can make Woo even better!', '{}', 'unactioned', 'woocommerce.com', '2023-10-20 22:45:42', NULL, 0, 'plain', '', 0, 1, 'info'),
(59, 'woocommerce-usermeta-Sept2023-productvendors', 'update', 'en_US', 'Your store requires a security update', '<strong>Your shop needs an update to address a vulnerability in WooCommerce.</strong> The fix was released on Sept 15. Please update WooCommerce to the latest version immediately. <a href=\"https://developer.woocommerce.com/2023/09/16/woocommerce-vulnerability-reintroduced-from-7-0-1/\" />Read our developer update</a> for more information.', '{}', 'pending', 'woocommerce.com', '2023-10-20 18:08:46', NULL, 0, 'plain', '', 0, 0, 'info'),
(60, 'wc_com_in_person_payments_card_sale_US_inbox_note_q4_23', 'marketing', 'en_US', 'Save 35% on a WooPayments card reader', 'Have you been thinking about selling your products or services in person? Nows the perfect time to do so, as were discounting our M2 card readers by 35%! Securely process payments wherever your business takes you, with full store and inventory sync. Dont miss out  this offer ends October 29, 2023.', '{}', 'pending', 'woocommerce.com', '2023-10-20 18:08:46', NULL, 0, 'plain', '', 0, 0, 'info'),
(61, 'wc_com_in_person_payments_card_sale_UK_inbox_note_q4_23', 'marketing', 'en_US', 'Save 35% on a WooPayments card reader', 'Have you been thinking about selling your products or services in person? Nows the perfect time to do so, as were discounting our WisePad 3 card readers by 35%! Securely process payments wherever your business takes you, with full store and inventory sync. Dont miss out  this offer ends 29th October 2023.', '{}', 'pending', 'woocommerce.com', '2023-10-20 18:08:46', NULL, 0, 'plain', '', 0, 0, 'info'),
(62, 'wc_com_in_person_payments_card_sale_CA_inbox_note_q4_23', 'marketing', 'en_US', 'Save 35% on a WooPayments card reader', 'Have you been thinking about selling your products or services in person? Nows the perfect time to do so, as were discounting our WisePad 3 card readers by 35%! Securely process payments wherever your business takes you, with full store and inventory sync. Dont miss out  this offer ends October 29, 2023.', '{}', 'pending', 'woocommerce.com', '2023-10-20 18:08:46', NULL, 0, 'plain', '', 0, 0, 'info'),
(63, 'woocommerce-STRIPE-Oct-2023-update-needed', 'update', 'en_US', 'Action required: Security update for WooCommerce Stripe Gateway', '<strong>Your shop requires a security update to address a vulnerability in the WooCommerce Stripe Gateway</strong>. The fix for this vulnerability was released on October 17. Please update immediately.', '{}', 'pending', 'woocommerce.com', '2023-10-20 18:08:46', NULL, 0, 'plain', '', 0, 0, 'info'),
(64, 'wc-admin-wc-helper-connection', 'info', 'en_US', 'Connect to WooCommerce.com', 'Connect to get important product notifications and updates.', '{}', 'unactioned', 'woocommerce-admin', '2023-10-20 18:10:41', NULL, 0, 'plain', '', 0, 1, 'info'),
(66, 'wc-admin-choosing-a-theme', 'marketing', 'en_US', 'Choosing a theme?', 'Check out the themes that are compatible with WooCommerce and choose one aligned with your brand and business needs.', '{}', 'unactioned', 'woocommerce-admin', '2023-10-22 02:15:48', NULL, 0, 'plain', '', 0, 0, 'info'),
(67, 'wc-admin-customizing-product-catalog', 'info', 'en_US', 'How to customize your product catalog', 'You want your product catalog and images to look great and align with your brand. This guide will give you all the tips you need to get your products looking great in your store.', '{}', 'unactioned', 'woocommerce-admin', '2023-10-22 18:19:02', NULL, 0, 'plain', '', 0, 0, 'info'),
(68, 'wc-admin-mobile-app', 'info', 'en_US', 'Install Woo mobile app', 'Install the WooCommerce mobile app to manage orders, receive sales notifications, and view key metrics  wherever you are.', '{}', 'unactioned', 'woocommerce-admin', '2023-10-22 18:19:02', NULL, 0, 'plain', '', 0, 0, 'info'),
(69, 'wc_admin_WooPay_Q4_2023', 'marketing', 'en_US', 'Convert more sales with our fastest checkout yet', 'Enable WooPay and offer the only single-click checkout experience built by Woo, for Woo. Give shoppers the power to pay instantly and securely speed through checkout, even if it\'s their first visit. Add it for free with one tap in your WooPayments dashboard.', '{}', 'pending', 'woocommerce.com', '2023-10-28 01:57:11', NULL, 0, 'plain', '', 0, 0, 'info'),
(70, 'wc_admin_WooPay_Oct30_2023', 'marketing', 'en_US', 'Convert more sales with our fastest checkout yet', 'Enable WooPay and offer the only single-click checkout experience built by Woo, for Woo. Give shoppers the power to pay instantly and securely speed through checkout, even if it\'s their first visit. Add it for free with one tap in your WooPayments dashboard.', '{}', 'pending', 'woocommerce.com', '2023-11-02 18:09:51', NULL, 0, 'plain', '', 0, 0, 'info'),
(71, 'paypal_paylater_q4_23', 'marketing', 'en_US', 'Boost your sales this holiday season with PayPal', 'Set yourself up for success this holiday season by allowing customers to pay the way they prefer. With the latest version of PayPal Payments, you can accept PayPal, Venmo (US), Pay Later*, credit and debit cards, and popular alternative payment methods in one secure solution.', '{}', 'pending', 'woocommerce.com', '2023-11-06 23:57:04', NULL, 0, 'plain', '', 0, 0, 'info'),
(72, 'wc-admin-orders-milestone', 'info', 'en_US', 'Congratulations on processing 10 orders!', 'You\'ve hit the 10 orders milestone! Look at you go. Browse some WooCommerce success stories for inspiration.', '{\"current_milestone\":10}', 'unactioned', 'woocommerce-admin', '2023-12-03 07:15:11', NULL, 0, 'plain', '', 0, 0, 'info'),
(73, 'wc-admin-new-sales-record', 'info', 'en_US', 'New sales record!', 'Woohoo, December 3rd was your record day for sales! Net sales was 1,952,100.00 beating the previous record of 10,600.00 set on October 21st.', '{\"old_record_date\":\"2023-10-21\",\"old_record_amt\":10600,\"new_record_date\":\"2023-12-03\",\"new_record_amt\":1952100}', 'unactioned', 'woocommerce-admin', '2023-12-03 18:58:46', NULL, 0, 'plain', '', 0, 0, 'info'),
(74, 'tap_to_pay_iphone_q4_2023_no_woopayments', 'marketing', 'en_US', 'Accept in-person contactless payments on your iPhone', 'Tap to Pay on iPhone and WooPayments is quick, secure, and simple to set up  no extra terminals or card readers are needed. Accept contactless debit and credit cards, Apple Pay, and other NFC digital wallets in person.', '{}', 'pending', 'woocommerce.com', '2023-12-05 18:09:03', NULL, 0, 'plain', '', 0, 0, 'info'),
(75, 'tap_to_pay_iphone_q4_2023_with_woopayments', 'marketing', 'en_US', 'New: accept in-person contactless payments on your iPhone', 'Tap to Pay on iPhone is quick, secure, and simple to set up in WooPayments  no extra terminals or card readers are needed. Accept contactless debit and credit cards, Apple Pay, and other NFC digital wallets in person in a few short steps!', '{}', 'pending', 'woocommerce.com', '2023-12-05 18:09:03', NULL, 0, 'plain', '', 0, 0, 'info'),
(76, 'wc-admin-launch-checklist', 'info', 'en_US', 'Ready to launch your store?', 'To make sure you never get that sinking \"what did I forget\" feeling, we\'ve put together the essential pre-launch checklist.', '{}', 'unactioned', 'woocommerce-admin', '2023-12-06 18:09:41', NULL, 0, 'plain', '', 0, 0, 'info'),
(77, 'amazon-mcf-reviews-2023-12-07', 'marketing', 'en_US', 'Enjoying Amazon MCF for WooCommerce?', 'We\'re Never Settle, the developers behind Amazon MCF for WooCommerce, and would be deeply honored to have your review. Reviews help immensely as other users can learn how MCF can solve their needs too! Not happy or need help? Please reach out for support and wed love to make things right!', '{}', 'pending', 'woocommerce.com', '2023-12-06 18:09:41', NULL, 0, 'plain', '', 0, 0, 'info');
